function isWithin10PercentRange(val1, val2) {
  const lowerBound = val1 * 0.9;
  const upperBound = val1 * 1.1;
  return val2 >= lowerBound && val2 <= upperBound;
}

function removeDuplicateFoods(arr) {
  const seen = new Map();

  // Filter out duplicate objects
  return arr.filter((item) => {
    const name = item.food_name;
    const calories = item.nf_calories;

    // Check if we have seen this food name before
    if (seen.has(name)) {
      const existingCalories = seen.get(name);

      // If calories are within 10% range, consider it a duplicate
      if (isWithin10PercentRange(existingCalories, calories)) {
        return false; // Duplicate found, filter out
      }
    }

    // Otherwise, add the food name and calorie value to the map
    seen.set(name, calories);
    return true;
  });
}

